css:
.terminal-pane {
  background-color: #0e1112;
  padding: 5px;
}
html .terminal {
  background-color: transparent;
  color: #d4d7d6;
  font-family: Menlo, courier-new, courier, monospace;
  padding: 5px;
}
html .terminal .xterm-viewport {
  background-color: transparent;
  z-index: 1;
}
html .terminal .xterm-text-layer {
  z-index: 2 !important;
}
html .terminal .xterm-selection-layer {
  z-index: 3 !important;
}
html .terminal .xterm-link-layer {
  z-index: 4 !important;
}
html .terminal .xterm-cursor-layer {
  z-index: 5 !important;
}
.terminal-pane {
  z-index: 0;
}
